import pytest

import compression


def test_tele2_request_page():
    string_to_check = 'abcdefghijklmnopqrstuvwxyz' \
                      'ABCDEFGHIJKLMNOPQRSTUVWXYZ' \
                      'абвгдеёжзийклмнопрстуфхцчшщьыъэюя' \
                      'АБВГДЕЁЖЗИЙКЛМНОПРСТУФХЦЧШЩЬЫЪЭЮЯ' \
                      '0123456789'
    encoded_string = ''
    result = compression.compress_str(string_to_check, False)
    assert result == encoded_string
